import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import { BrowserRouter, Route, Switch } from "react-router-dom"

import Login from './routes/login';

class App extends Component {
  constructor() {
    super()
  }
  render() {
    return (
      <div>
        <BrowserRouter>
          <Switch>
            <Route path="/login" >
              <Login/>
            </Route>
          </Switch>
        </BrowserRouter>


      </div>
    )
  }
}

export default App;
